import React, { Component } from 'react';

class Aboutus extends Component {
	constructor(props) {
		super(props);
	}
	
	render() {
		return (
			<div>
				 <div className="content">
					<h1>About Us</h1>
					<p>
						With a varied passion in the arts such as photography, writing, painting, drawing, video creations, cooking and so much more, we hope to capture unique and unforgettable moments.
						We are inspired by the many holiday movies and strive to have some of our photographs represent ‘a little touch of holiday magic!’ Our love for the outdoors especially during the
						four seasons is captured with the help of nature’s beauty. One thing is for sure, our goal is to capture photos that are definitely worth sharing.
					</p>
				</div>
			</div>
		);
	}
}
export default Aboutus;
